INSERT INTO `studies` VALUES (1,10,'Nedialkova15','Nedialkova DD, Leidel SA','SRP056647','2015','26052047','\"https://linkinghub.elsevier.com/retrieve/pii/S0092-8674(15)00571-1\"','GSE67387','None','Optimization of Codon Translation Rates via tRNA Modifications Maintains Proteome Integrity. ','Ribosome profiling of wild-type and tRNA modification-deficient yeast and nematodes. Yeast samples were generated in various growth conditions (rich medium versus stress induced by treatment with diamide or rapamycin) and paired mRNA-Seq was performed on a subset of samples. Dataset contains three biological replicates for yeast samples and two biological replicates for nematode samples.',0,1);
