INSERT INTO `studies` VALUES (5,8,'Li14','Li GW, Burkhardt D, Gross C, Weissman JS','SRP034871','2014','24766808','\"https://linkinghub.elsevier.com/retrieve/pii/S0092-8674(14)00232-3\"','GSE53767','(CTGTAGGCACCATCAAT, 449002.0)','Quantifying absolute protein synthesis rates reveals principles underlying allocation of cellular resources. ','4 samples of E. coli ribosome profiling and mRNA-seq, including biological replicates',0,1);
INSERT INTO `studies` VALUES (6,8,'Liu13','Liu X, Jiang H, Gu Z, Roberts JW','SRP023499','2013','23812753','\"http://www.pnas.org/cgi/pmidlookup?view=long&amp;pmid=23812753\"','GSE47509','(AAAAAAAAAAAAAAAA, 209955.0)','High-resolution view of bacteriophage lambda gene expression by ribosome profiling. ','We chose temperature induction of the classic cI857 repressor mutation in a lysogen of E. coli MG1655 in order to synchronize the lytic process, sampling the lysogen and control non-lysogen both before and 2, 5, 10, and 20 minutes after shifting the temperature from 32Â° to 42Â°.  The last sample time was chosen to be before any significant cell lysis, but during the later stages of lytic gene expression. Total protected nucleotides within open reading frames were summed to determine the density of translation of each reading frame.  We take this number to indicate the overall rate of translation, although obviously this assumes that pauses in translation do not excessively affect the overall rate.  Since the expression level is not normalized for the copy number of the replicating phage DNA, it thus encompasses both the effect of DNA template availability on mRNA synthesis and the efficiency of utilization of messengers by ribosomes.',0,1);
INSERT INTO `studies` VALUES (7,8,'Li12','Li GW, Oh E, Weissman JS','SRP010825','2012','22456704','\"http://dx.doi.org/10.1038/nature10965\"','GSE35641','(CTGTAGGCACCATCAAT, 0)','The anti-Shine-Dalgarno sequence drives translational pausing and codon choice in bacteria. ','Identification of translation pause sites in vivo using ribosome profiling',0,1);
