INSERT INTO `studies` VALUES (10,1,'Guydosh14','Guydosh NR, Green R','SRP033499','2014','24581494','\"https://linkinghub.elsevier.com/retrieve/pii/S0092-8674(14)00162-7\"','GSE52968','(CTGTAGGCACCATCAAT, 0)','Dom34 rescues ribosomes in 3\' untranslated regions. ','25 samples are included in the study (2 mRNA-Seq samples and 23 ribosome footprint profiling samples). These include wild-type and dom34 or hbs1 knockout strains that were created in a variety of genetic backgrounds, treated with various agents in cell culture (e.g. diamide, 3-AT, or glucose starvation), treated differently during cell lysis (use of cycloheximide vs. other ribosome-stabilizing agents), or prepared in different ways after cell lysis (e.g. retention of short vs. long monosome-protected footprints or disome footprints).',0,1);
INSERT INTO `studies` VALUES (11,1,'Young15','Young DJ, Guydosh NR, Zhang F, Hinnebusch AG, Green R','SRP058910','2015','26276635','\"https://linkinghub.elsevier.com/retrieve/pii/S0092-8674(15)00957-5\"','GSE69414','(CTGTAGGCACCATCAAT, 391971.0)','Rli1/ABCE1 Recycles Terminating Ribosomes and Controls Translation Reinitiation in 3\'UTRs In Vivo. ','10 biological samples are included in the study (2 mRNA-Seq samples and 8 ribosome footprinting samples). These include wild-type, rli1-depletion, rli1-depletion/dom34Î”, and RLI1 high-copy / dom34Î” strains. Samples are also included where cells were treated with 3-AT to starve for histidine.',0,1);
